import React from 'react'
import AddContact from './AddContact'
import {useSelector} from 'react-redux'

const Contacts = () => {

  const contactList = useSelector(state => state.contacts) 

  return (
    <>
      <h1>Contacts and Redux</h1>

      <ul>
        {contactList.map()}
      </ul>
      <AddContact />
    </>
  )
}

export default Contacts
